                        var $target = $(ev.target).parent('[data-prevent-scroll="slider"]');
                        if ($target.length > 0) {
                            return;
                        }
                        if (App.isPaiApp) {
                            hide_key_board();
                            App.app_back();
                        }
                        return false;
