            for (var i = 0; i < settings_len; i++) {
                settings.push(i * show_len);
            }
            //var start = settings[parseInt(Math.random()*(settings_len - 1 + 1 ) + 1)];
            var start = settings[self.start_setted];
            var end = start == 0 ? (start + 1) * show_len : start * 2;
