        /**
         * 信息填写弹框
         * @param event
         * @private
         */
        _popup: function(event) {
            var self = this;
            var $target = $(event.currentTarget);
            var targetNav = $target.attr("data-target");
            var items = [];
            switch (targetNav) {
              case "height":
                items = [ {
                    unit: "cm",
                    name: "身高",
                    "input-type": "tel",
                    "input-role": "height",
                    "input-data-role": "height"
                } ];
                break;

              case "weight":
                items = [ {
                    unit: "kg",
                    name: "体重",
                    "input-type": "tel",
                    "input-role": "weight",
                    "input-data-role": "weight"
                } ];
                break;

              case "cup":
                items = [ {
                    unit: "",
                    name: "罩杯",
                    "input-role": "cup",
                    "input-type": "tel",
                    "input-data-role": "cup"
                } ];
                break;

              case "cwh":
                var cwh = self.$cwh.html().split("-");
                items = [ {
                    unit: "cm",
                    name: "胸围",
                    "input-role": "cwh",
                    "input-type": "tel",
                    value: cwh[0],
                    "input-data-role": "chest"
                }, {
                    unit: "cm",
                    name: "腰围",
                    "input-role": "cwh",
                    "input-type": "tel",
                    value: cwh[1],
                    "input-data-role": "waist"
                }, {
                    unit: "cm",
                    name: "臀围",
                    "input-role": "cwh",
                    "input-type": "tel",
                    value: cwh[2],
                    "input-data-role": "hip"
                } ];
                break;
            }
            var saveDialog = new Dialog({
                content: self._render_popup_item(items),
                buttons: [ {
                    name: "save",
                    text: "确定"
                }, {
                    name: "close",
                    text: "取消"
                } ]
            }).on("tap:button:save", function() {
                var text;
                //确定完成后的text
                var set_html_target;
                var input_data_role;
                var texts = [];
                var this_text;
                //下面循环中当前text;
                for (var i = 0; i < this.$("input").length; i++) {
                    this_text = self.to_number(this.$("input")[i].value);
                    input_data_role = $(this.$("input")[i]).attr("input-data-role");
                    if (!/^\d*$/.test(this_text)) {
                        Tip.show("请输入大于0的数字！", "error", {
                            delay: 1e3
                        });
                        return false;
                    }
                    if (!this_text) {
                        Tip.show("不能为0或空哦！", "error", {
                            delay: 800
                        });
                        return false;
                    }
                    //各项的最大值控制
                    switch (input_data_role) {
                      case "height":
                        if (this_text > 300) {
                            Tip.show("身高不能超过300cm哦！", "error", {
                                delay: 800
                            });
                            return false;
                        }
                        break;

                      case "weight":
                        if (this_text > 150) {
                            Tip.show("体重不能超过150kg哦！", "error", {
                                delay: 800
                            });
                            return false;
                        }
                        break;

                      case "chest":
                      case "waist":
                      case "hip":
                        if (this_text > 200) {
                            Tip.show("三围不能有超过200cm的哦！", "error", {
                                delay: 800
                            });
                            return false;
                        }
                        break;
                    }
                    texts.push(this_text);
                    if (i == 0) {
                        set_html_target = $(this.$("input")[0]).attr("input-role");
                    }
                    //设置三围于attr中
                    if (set_html_target == "cwh") {
                        self.$cwh.attr("data-" + input_data_role, this_text);
                        if (input_data_role == "chest") {
                            //设置罩杯
                            var old_cup = self.$cup.html().replace(/\d*/, "");
                        }
                    }
                    self.model_info[input_data_role] = this_text;
                }
                text = texts.join("-");
                self.$("[data-target=" + set_html_target + "]").html(text);
                this.hide().destroy();
            }).on("tap:button:close", function() {
                this.hide().destroy();
            }).show();
        },
        /**
         * 导航到目的页面
         * @param event
         * @private
         */
        navigate_to_page: function(ev, type) {
            var self = this;
            var target_nav;
            var $target;
            if (type) {
                target_nav = type;
                $target = ev;
            } else {
                $target = $(ev.currentTarget);
                target_nav = $target.attr("data-target");
            }
            if (target_nav != "model_preview") {
                $target.addClass("cur").siblings().removeClass("cur");
            }
            switch (target_nav) {
              case "model_pic":
                if (!self.$model_pic.hasClass("fn-hide")) {
                    return;
                }
                self.$model_pic.removeClass("fn-hide");
                self.$model_info.addClass("fn-hide");
                self.$model_price.addClass("fn-hide");
                //self.$model_pic.addClass('fn-hide');
                //self.$footer.addClass('fn-hide');
                self.$title.html("编辑模特卡");
                /*self.$back.attr({
                        'hide-page':target_nav
                    })*/
                self.view_scroll_obj.refresh();
                break;

              case "model_info":
                if (!self.$model_info.hasClass("fn-hide")) {
                    return;
                }
                self.$model_info.removeClass("fn-hide");
                self.$model_pic.addClass("fn-hide");
                self.$model_price.addClass("fn-hide");
                //self.$footer.addClass('fn-hide');
                self.$title.html("修改个人资料");
                /*self.$back.attr({
                        'hide-page':target_nav
                    })*/
                self.view_scroll_obj.refresh();
                break;

              case "model_price":
                if (!self.$model_price.hasClass("fn-hide")) {
                    return;
                }
                self.$model_price.removeClass("fn-hide");
                self.$model_pic.addClass("fn-hide");
                self.$model_info.addClass("fn-hide");
                //self.$footer.addClass('fn-hide');
                self.$title.html("修改价格");
                /*self.$back.attr({
                        'hide-page':target_nav
                    })*/
                self.view_scroll_obj.refresh();
                break;

              case "model_preview":
                self._get_all_value();
                page_control.navigate_to_page("model_card/" + Utility.login_id, {
                    data: self.model_info
                });
                break;
            }
        },
