    var mine_model = require("pai/0.0.1-beta/mine/model-debug");
    var grid = require("pai/0.0.1-beta/widget/model_pic/view-debug");
    var App = require("pai/0.0.1-beta/common/I_APP-debug");
    var global_config = require("pai/0.0.1-beta/common/global_config-debug");
    var follow = require("pai/0.0.1-beta/widget/follow/index-debug");
    var main_tpl = require("pai/0.0.1-beta/mine/zone/tpl/main_v2-debug.handlebars");
