define("pai/0.0.1-beta/demand/model-debug", [ "pai/0.0.1-beta/common/global_config-debug", "utility/backbone/1.1.2/backbone-debug" ], function(require, exports, module) {
    //基础框架
    var global_config = require("pai/0.0.1-beta/common/global_config-debug");
    var Backbone = require("utility/backbone/1.1.2/backbone-debug");
    module.exports = Backbone.Model.extend({
        // idAttribute : 'location_id',
        url: global_config.ajax_url.demand_text,
        "default": {},
        /**
         * 安装事件
         * @private
         */
        setup_events: function() {},
        parse: function(response) {
            if (response.result_data) {
                return response.result_data;
            }
            return response;
        },
        // 初始化，传递参数
        initialize: function(options) {
            var self = this;
            self.setup_events();
        },
        //获取数据请求
        get_list: function() {
            var self = this;
            self.fetch({
                url: self.url,
                data: {
                    id: self.get("id") || 0
                },
                cache: false,
                beforeSend: function(xhr, options) {
                    self.trigger("before:fetch", xhr, options);
                },
                success: function(collection, response, options) {
                    self.trigger("success:fetch", response, options);
                },
                error: function(collection, response, options) {
                    self.trigger("error:fetch", response, options);
                },
                complete: function(xhr, status) {
                    self.trigger("complete:fetch", xhr, status);
                }
            });
        },
        send_data: function(data) {
            var self = this;
            self.fetch({
                url: global_config.ajax_url.add_requirement_act,
                data: {
                    data_str: data
                },
                type: "POST",
                cache: false,
                beforeSend: function(xhr, options) {
                    self.trigger("before:send_data:fetch", xhr, options);
                },
                success: function(collection, response, options) {
                    self.trigger("success:send_data:fetch", response, options);
                },
                error: function(collection, response, options) {
                    self.trigger("error:send_data:fetch", response, options);
                },
                complete: function(xhr, status) {
                    self.trigger("complete:send_data:fetch", xhr, status);
                }
            });
        }
    });
});

